import React from "react";
import "./App.css";
import data from "./data/testData.js";

function Info(props) {
  return (
    <div className={`youtube__item ${pr}`}>
      <img src={props.headerImg} alt="" className="header__img" />
      <div className="info">
        <img src={props.user} alt="" className="user" />
        <div className="post">
          <p className="author">{props.author}</p>
          <p className="header__desc">{props.desc}</p>
        </div>
      </div>
    </div>
  );
}

const Test = () => {
  return (
    <div className="youtube__list">
      {data.map((item, index) => {
        return (
          <Info
            key={item.id}
            headerImg={item.headerImage}
            user={item.userImage}
            author={item.author}
            desc={item.desc}
          ></Info>
        );
      })}
    </div>
  );
};

export default Test;
